import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import VacationDisplayAll from './VacationDisplay'

const Vacations = () => {
    return (
        <div className="container">
            <nav id="vacationNav" className="flex justify-center">
                <Link to="/vacation/new" className="ring-1 ring-offset-stone-100 bg-emerald-500 text-white hover:bg-emerald-800 py-1 px-2 rounded-full mx-1">Create</Link>
                <Link to="/vacation/:id" className="ring-1 ring-offset-stone-100 bg-blue-500 text-white hover:bg-blue-800 py-1 px-2 rounded-full mx-1">Read</Link>
                <Link to="/vacation/edit/:id" className="ring-1 ring-offset-stone-100 bg-red-500 text-white hover:bg-red-800 py-1 px-2 rounded-full mx-1">Edit</Link>
            </nav>
            <Outlet />
            {/* <VacationDisplayAll /> */}
        </div>
    )
}

export default Vacations
